@realDonaldTrump Watching you implode in rage tweets is strangely satisfying. 

You are further cementing your legacy as a petulant debutante. 

Sack up, Don. Be a man.

@joshuatopolsky @cbondcarolina Let me explain exactly how Wallyworld's "shipping from hell" works...

Nevermind. Even joking about it makes me wanna rage quit life. And currently, I can't afford to buy another one to replace it. Nor the patience for shipping.

Look at that. Back to where we started. *CRC LOOP*
